import React  from "react";
import One from "./One";

function Player(props){
    console.log(`Dadosa = ${props.bg}`);
    let poT , poL;
    if(props.bg === "var(--primary)"){ poT="0%"; poL="0%";}
    else if(props.bg === "var(--danger)"){ poT="calc(100vh - 150px)"; poL="0px";}
    else if(props.bg === "var(--success)"){poT="calc(100vh - 150px)";poL="calc(100% - 150px)";}
    else if(props.bg === "var(--warning)"){ poT="0%"; poL="calc(100% - 150px)"; }  

    
    switch (props.num){
        case 1 :  <One /> ;break;
        case 2 :  <Two /> ;break;
        case 3 :  <Three /> ;break;
        case 4 :  <Four /> ;break;
        case 5 :  <Five /> ;break;
        case 6 :  <Six /> ;break;
        default:break;
    }
    
    return(
        <div className="Player_cadre bg-light position-absolute rounded border border-5 d-flex justify-content-center align-items-center"
        style={{top:poT, left:poL}}>
            <div className="Player_dadosa border rounded" style={{backgroundColor:props.bg}}>
                <One />
            </div>
        </div>
    )
}

export default React.memo(Player);
